package pack1;

public class For_test {
     void display(int n) {
    	 for (int i=0;i<n;i++) {
    		 for (int j=0;j<1;j++) {
    		 System.out.println("*");
    	 }
    	System.out.println();	 
    	 }	 
    	 
     }
	public static void main(String[] args) {
		// TODO Auto-generated method stub
		For_test f= new For_test ();
		f.display(5);
	}

}
	